import React, { useState } from "react";
import { Navbar, Footer } from "./CommonUI";

const Dashboard = ({ isDarkMode, toggleDarkMode }) => {
  const [sidebarOpen, setSidebarOpen] = useState(false);
  const [recordPage, setRecordPage] = useState(0);

  const toggleSidebar = () => setSidebarOpen(!sidebarOpen);

  // Dummy Data
  const leaderboard = [
    { rank: 1, name: "Alice", score: "95%" },
    { rank: 2, name: "Bob", score: "90%" },
    { rank: 3, name: "Charlie", score: "85%" },
    { rank: 4, name: "David", score: "82%" },
    { rank: 5, name: "Eve", score: "80%" },
  ];

  const pastRecords = [
    { date: "01-10-2025", score: "80%" },
    { date: "05-10-2025", score: "75%" },
    { date: "10-10-2025", score: "82%" },
    { date: "15-10-2025", score: "78%" },
    { date: "20-10-2025", score: "88%" },
    { date: "25-10-2025", score: "85%" },
    { date: "30-10-2025", score: "90%" },
    { date: "04-11-2025", score: "92%" },
    { date: "09-11-2025", score: "87%" },
    { date: "14-11-2025", score: "89%" },
  ];

  const last5Exams = [
    { exam: "Mock 1", percentage: 80 },
    { exam: "Mock 2", percentage: 75 },
    { exam: "Mock 3", percentage: 82 },
    { exam: "Mock 4", percentage: 78 },
    { exam: "Mock 5", percentage: 88 },
  ];

  const blueShade = "#1E90FF"; // Blue color

  return (
    <div
      style={{
        fontFamily: "'Poppins', sans-serif",
        minHeight: "100vh",
        backgroundColor: "#ffffff",
        transition: "all 0.3s",
      }}
    >
      {/* ---------- NAVBAR ---------- */}
      <Navbar
        isDarkMode={isDarkMode}
        toggleDarkMode={toggleDarkMode}
        isLoggedIn={true}
        navbarStyle={{
          backgroundColor: "#06400F",
          color: "white",
          boxShadow: "0 2px 5px rgba(0,0,0,0.2)",
        }}
      />

      <div style={{ display: "flex" }}>
        {/* ---------- SIDEBAR ---------- */}
        <div
          style={{
            width: sidebarOpen ? "220px" : "40px",
            backgroundColor: "#06400F",
            color: "white",
            transition: "width 0.3s",
            padding: "20px 10px",
            display: "flex",
            flexDirection: "column",
            alignItems: sidebarOpen ? "flex-start" : "center",
            borderRight: "1px solid #0B3D02",
            minHeight: "calc(100vh - 60px)",
          }}
        >
          <button
            onClick={toggleSidebar}
            style={{
              backgroundColor: sidebarOpen ? "#0B3D02" : "#06400F",
              color: "white",
              border: "none",
              padding: "8px",
              borderRadius: "5px",
              cursor: "pointer",
              marginBottom: "20px",
              width: sidebarOpen ? "100%" : "35px",
              transition: "all 0.3s",
            }}
          >
            {sidebarOpen ? "Close" : "≡"}
          </button>

          {sidebarOpen && (
            <div style={{ marginTop: "20px", fontSize: "14px" }}>
              <div style={{ marginBottom: "15px", fontWeight: "bold" }}>Profile</div>
              <div style={{ marginBottom: "10px" }}>
                <strong>Name:</strong> John Doe
              </div>
              <div style={{ marginBottom: "10px" }}>
                <strong>Email:</strong> john.doe@example.com
              </div>
              <div style={{ marginBottom: "10px" }}>
                <strong>Role:</strong> Student
              </div>
            </div>
          )}
        </div>

        {/* ---------- MAIN CONTENT ---------- */}
        <div style={{ flex: 1, padding: "30px", color: "#06400F" }}>
          {/* Dashboard title + start button */}
          <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
            <h2>Dashboard</h2>
            <button
              style={{
                backgroundColor: blueShade,
                color: "white",
                border: "none",
                padding: "10px 20px",
                borderRadius: "8px",
                cursor: "pointer",
                fontWeight: "bold",
                boxShadow: "0 2px 5px rgba(0,0,0,0.2)",
                transition: "all 0.3s",
              }}
              onMouseEnter={e => (e.target.style.backgroundColor = "#1C86EE")}
              onMouseLeave={e => (e.target.style.backgroundColor = blueShade)}
            >
              Start Exam
            </button>
          </div>

          {/* ---------- Summary Cards ---------- */}
          <div style={{ display: "flex", gap: "20px", marginTop: "20px" }}>
            {[
              { title: "Total Attempts", value: 10 },
              { title: "Total Days Active", value: 25 },
              { title: "Position", value: "3rd" },
            ].map((card, idx) => (
              <div
                key={idx}
                style={{
                  flex: 1,
                  backgroundColor: blueShade,
                  padding: "20px",
                  borderRadius: "12px",
                  boxShadow: "0 4px 10px rgba(0,0,0,0.2)",
                  textAlign: "center",
                  color: "white",
                  cursor: "pointer",
                  transition: "all 0.3s",
                }}
                onMouseEnter={e => {
                  e.currentTarget.style.transform = "translateY(-5px)";
                  e.currentTarget.style.boxShadow = "0 8px 15px rgba(0,0,0,0.3)";
                }}
                onMouseLeave={e => {
                  e.currentTarget.style.transform = "translateY(0)";
                  e.currentTarget.style.boxShadow = "0 4px 10px rgba(0,0,0,0.2)";
                }}
              >
                <div style={{ fontSize: "18px", fontWeight: "bold" }}>{card.title}</div>
                <div style={{ fontSize: "28px", marginTop: "10px" }}>{card.value}</div>
              </div>
            ))}
          </div>

          {/* ---------- Pie Chart + Description ---------- */}
          <div style={{ display: "flex", gap: "30px", marginTop: "40px", alignItems: "center" }}>
            {/* Pie Chart */}
            <div
              style={{
                width: "200px",
                height: "200px",
                borderRadius: "50%",
                background: `conic-gradient(${blueShade} 0% 78%, #e0e0e0 78% 100%)`,
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                fontWeight: "bold",
                color: "#06400F",
                fontSize: "24px",
                boxShadow: "0 4px 12px rgba(0,0,0,0.15)",
              }}
            >
              78%
            </div>

            {/* Description */}
            <div style={{ flex: 1 }}>
              <h3>Average Marks</h3>
              <p>
                This represents the average marks you have obtained across all your attempted exams. It helps
                you track your overall progress and performance. Keep practicing to improve your score over time!
              </p>
            </div>
          </div>
        </div>
      </div>

      <Footer />
    </div>
  );
};

export default Dashboard;
